import React from 'react';
import classes from '../../../../../Css/DrawerToggle.module.css'

const DrawerToggle = (props) => {

    let attachedClasses = [classes.DrawerToggle, classes.Closed];
    if (props.open) {
        attachedClasses=[classes.DrawerToggle, classes.Open];
    }

    return (
        <div className={attachedClasses.join(' ')} onClick={props.click}>
            <div></div>
            <div></div>
            <div></div>
        </div>
    )
};

export default DrawerToggle;
